import React, { useState, useEffect } from 'react';
import { Link, useLocation } from 'react-router-dom';

const Navbar = () => {
  const [isScrolled, setIsScrolled] = useState(false);
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);
  const location = useLocation();

  useEffect(() => {
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 50);
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const toggleMobileMenu = () => {
    setIsMobileMenuOpen(!isMobileMenuOpen);
  };

  const closeMobileMenu = () => {
    setIsMobileMenuOpen(false);
  };

  const isActive = (path) => {
    return location.pathname === path;
  };

  return (
    <>
      {/* Desktop Navbar */}
      <nav className={`fixed top-0 left-0 right-0 z-50 transition-all duration-300 ${
        isScrolled ? 'bg-white/95 backdrop-blur-md shadow-lg' : 'bg-transparent'
      }`}>
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex justify-between items-center h-16">
            {/* Logo */}
            <Link to="/" className="flex items-center space-x-2">
              <img 
                src="/Assets/Navlogo.png" 
                alt="Logo" 
                className="h-8 w-8"
              />
              <span className="text-xl font-bold text-gray-900">Portfolio</span>
            </Link>

            {/* Desktop Navigation */}
            <div className="hidden md:flex items-center space-x-8">
              <Link 
                to="/" 
                className={`text-sm font-medium transition-colors duration-200 ${
                  isActive('/') ? 'text-purple-600' : 'text-gray-700 hover:text-purple-600'
                }`}
              >
                Home
              </Link>
              <Link 
                to="/about" 
                className={`text-sm font-medium transition-colors duration-200 ${
                  isActive('/about') ? 'text-purple-600' : 'text-gray-700 hover:text-purple-600'
                }`}
              >
                About
              </Link>
              <Link 
                to="/projects" 
                className={`text-sm font-medium transition-colors duration-200 ${
                  isActive('/projects') ? 'text-purple-600' : 'text-gray-700 hover:text-purple-600'
                }`}
              >
                Projects
              </Link>
              <Link 
                to="/contact" 
                className={`text-sm font-medium transition-colors duration-200 ${
                  isActive('/contact') ? 'text-purple-600' : 'text-gray-700 hover:text-purple-600'
                }`}
              >
                Contact
              </Link>
            </div>

            {/* Mobile Menu Button */}
            <button
              onClick={toggleMobileMenu}
              className="md:hidden p-2 rounded-md text-gray-700 hover:text-purple-600 hover:bg-gray-100 transition-colors duration-200"
              aria-label="Toggle mobile menu"
            >
              <svg
                className={`h-6 w-6 transition-transform duration-200 ${
                  isMobileMenuOpen ? 'rotate-90' : ''
                }`}
                fill="none"
                stroke="currentColor"
                viewBox="0 0 24 24"
              >
                {isMobileMenuOpen ? (
                  <path
                    strokeLinecap="round"
                    strokeLinejoin="round"
                    strokeWidth={2}
                    d="M6 18L18 6M6 6l12 12"
                  />
                ) : (
                  <path
                    strokeLinecap="round"
                    strokeLinejoin="round"
                    strokeWidth={2}
                    d="M4 6h16M4 12h16M4 18h16"
                  />
                )}
              </svg>
            </button>
          </div>
        </div>

        {/* Mobile Menu */}
        <div className={`md:hidden transition-all duration-300 ease-in-out ${
          isMobileMenuOpen 
            ? 'max-h-64 opacity-100 transform translate-y-0' 
            : 'max-h-0 opacity-0 transform -translate-y-2'
        } overflow-hidden bg-white/95 backdrop-blur-md shadow-lg`}>
          <div className="px-4 py-2 space-y-1">
            <Link
              to="/"
              onClick={closeMobileMenu}
              className={`block px-3 py-2 text-base font-medium rounded-md transition-colors duration-200 ${
                isActive('/') ? 'text-purple-600 bg-purple-50' : 'text-gray-700 hover:text-purple-600 hover:bg-gray-50'
              }`}
            >
              Home
            </Link>
            <Link
              to="/about"
              onClick={closeMobileMenu}
              className={`block px-3 py-2 text-base font-medium rounded-md transition-colors duration-200 ${
                isActive('/about') ? 'text-purple-600 bg-purple-50' : 'text-gray-700 hover:text-purple-600 hover:bg-gray-50'
              }`}
            >
              About
            </Link>
            <Link
              to="/projects"
              onClick={closeMobileMenu}
              className={`block px-3 py-2 text-base font-medium rounded-md transition-colors duration-200 ${
                isActive('/projects') ? 'text-purple-600 bg-purple-50' : 'text-gray-700 hover:text-purple-600 hover:bg-gray-50'
              }`}
            >
              Projects
            </Link>
            <Link
              to="/contact"
              onClick={closeMobileMenu}
              className={`block px-3 py-2 text-base font-medium rounded-md transition-colors duration-200 ${
                isActive('/contact') ? 'text-purple-600 bg-purple-50' : 'text-gray-700 hover:text-purple-600 hover:bg-gray-50'
              }`}
            >
              Contact
            </Link>
          </div>
        </div>
      </nav>

      {/* Spacer to prevent content from hiding behind fixed navbar */}
      <div className="h-16"></div>
    </>
  );
};

export default Navbar;
